import React from 'react';
import ScrollAnim from 'rc-scroll-anim';
import content from './SectionsContent';
import iniciaScroll from './Scroll';
import Button from '@material-ui/core/Button';
import Twn from './Twn';
import Dial from './Dialog';
import Transition from './Transition';
const ScrollOverPack = ScrollAnim.OverPack;


const find = id => content.find(p => p.id === id);

const OverPack = ({data}) => {
    let n = find(data.params.id);

    return (
        <ScrollOverPack
            always={true}
            appear={true}
                componentProps={{ tweenOne2:  {reverse :true }, tweenOne:  {reverse :true } }}
            className={n.classe}
            id={n.hash}
            playScale={0.5}>
            <Button
            // onClick={this.onPlay}
            >
            <i class="material-icons ver_mais">
trending_flat
</i>
        </Button>
            {Twn({n: n})}
            {Transition({n: n})}
        </ScrollOverPack>
    )
}
class Home extends React.Component {
    componentDidMount() {
        iniciaScroll();
    }
    render() {
        return (content.map((i) => (<OverPack
            data={{
            params: {
                id: i.id
            }
        }}/>)));
    }
}

export default Home;
